  return (
    <Router>
      <Switch>
        <Route path="/criar-cliente" component={CreateClientForm} />
        <Route path="/atendimento" component={AtendimentoPage} />
        {/* Outras rotas */}
      </Switch>
    </Router>
  );
};

export default App;
